import React from 'react';
import './login.css';
import { Link } from 'react-router-dom';

const Login = ({userData}) => {
  return (
    <form className='login'>
      <div className='logoBox' data-aos='fade-up' data-aos-duration='3000'>
        <h1>Petstagram</h1>
        <h4>Connect with pets on Petstagram</h4>
      </div>

      <div>
        <input
          onChange={(e) => userData.handleLogin(e)}
          placeholder='Id'
          name='username'
        />
        <input
          onChange={(e) => userData.handleLogin(e)}
          placeholder='Password'
          name='password'
        />

        <Link to='/home'>
          <button className='loginBtn' onClick={(e) => userData.validateLogin(e)}>
            Log In
          </button>
        </Link>

        <Link to='/sign-up'>
          <button className='newAccountBtn'>Sign Up</button>
        </Link>
      </div>
    </form>
  );
};

export default Login;
